export const goldenCertificates = {
  mainnetSystem: ``,
  mainnetApplication: ``,
  localSystem: ``,
  localApplication: ``,
};

test('goldenCertificates', () => {
  // file needs to include at least one test,
  // so we test if the certificates are not removed from the constant
  expect(goldenCertificates).toHaveProperty('mainnetSystem');
  expect(goldenCertificates).toHaveProperty('mainnetApplication');
  expect(goldenCertificates).toHaveProperty('localSystem');
  expect(goldenCertificates).toHaveProperty('localApplication');
  expect(goldenCertificates).not.toHaveProperty('notExistingProp');
});
